textOriginal:
Sobre o lula / Dilma eu confirmo/ afirmo assinando em baixo, pois foi a pior época da minha vida estudar em uma escola pública entre 2005-2012 , estudando no Goiás:
- greves constantes (tiveram vezes que ficávamos quase 1 mês inteiro sem aula, devido a falta de pagamento dos salários dos professores e por culpa disso ficamos repondo aula no sábado e perdemos nossas férias);
- maior índice de violência;
- os professores viviam de atestado médico. Como tinha esse negócio de 5 horários e cada professor ficava com um ou dois por dia. Quando não vinham deixavam um buraco no horário e só tínhamos duas opções: ou esperar na sala de aula até acabar o horário do professor para que o próximo venha ou teriamos que sair correndo atrás dos outros professores para que eles "subissem as aulas". As vezes faltavam quase todos e nessas situações vinham os dos últimos horários (aí já viu: tínhamos que esperar até dar o segundo/ terceiro horário para pedir a algum professor subir aula ou combinavamos de nós comportar em sala de aula e um aluno pegaria o conteúdo e passaria para o resto da turma, para que assim pudéssemos sair mais cedo). As vezes tínhamos que voltar no mesmo rastro para casa pois todos os professores, vez ou outra faltavam;
- falta de conteúdo que o professor não passava devido às faltas excessivas. Teve uma vez que o professor nos entregou o diário de nota e pediu para que escrevessemos as notas que queríamos. Todo mundo pôs 10 (inclusive eu, relutante, por honestidade coloquei 9,5 kkkk pois não ficaria prejudicado sem nota).
